//import img from './img.svg';

const Thunderbutton = () => {
	return (
		<div className='bg-light-gray dib br3 pa3 ma2 grow bw2 shadow-5'>
		<button id="home_button" onclick="myFunction()" ></button>
		</div>
)

				function myFunction() {
  					console.log('asdasd')  // The function returns the product of p1 and p2
		}
};

